import "./App.css";
import SearchBar from "./components/search";
import logo from "./img/400.png";
import { ScrollPanel } from "primereact/scrollpanel";

function App() {
  return (
    <ScrollPanel className="bg">
      <ScrollPanel className="App">
        <img
          alt="Chemistrphile"
          src={logo}
          style={{
            margin: "auto",
            display: "block",
            marginBottom: "-50px",
            borderRadius: "5%",
          }}
        />
        <SearchBar></SearchBar>
      </ScrollPanel>
    </ScrollPanel>
  );
}

export default App;
